import React from "react";

const TransactionHistoryList = ({type, amount, currency}) => (
  <>
    <td>
      <th>{type}</th>
      <th>{amount}</th>
      <th>{currency}</th>
    </td>
  </>
);

export default TransactionHistoryList;
